Brand new unfired Glock 26 Generation 4 subcompact 9mm holds 10 in the magazine plus one in the chamber. Will also accept Glock 17, 18 and 19 magazines. Comes with original case, three 10-round factory mags, loader, cleaning rod and brush, paperwork, etc. Will also include a DeSantis Nemesis pocket holster and the following self-defense ammo:

2 factory boxes (40 rounds) of Federal Premium Hydra-Shok 147-grain JHP;

2 factory boxes (40 rounds) of Federal Premium Hydra-Shok 135-grain JHP;

1 factory box (20 rounds) plus 11 loose rounds of Federal Premium Hydra-Shok 115-grain JHP;

1 factory box (20 rounds) plus 2 loose rounds of Dynamic Research Technologies (D.R.T.) 90-grain frangible JHP.

Cash only, no trades. Buyer must sign bill of sale.
